const Axios = require('axios')
const securityFootage = require('./carsTest.mp4')

const sendImage = () => {

    // get screenshot from current video 

    // read license plate (if there is any)

    // check db for the plate

    // if unrecognized, send to db and alert 

    currentPlateNumber = '123456'

    async () => {

        let response = await Axios.post('/unrecognized/addUnrecognized', {
            plateNumber: currentPlateNumber
        })

        console.log(response)
    }

    console.log("Sending Camera Feed... Searching for plate")

}

module.exports = sendImage
